import shopdata from '../../shop-data.json';


const Shop = () => {
    return (
        <div>
            {shopdata.map((product) => {
                <div key={product.id}>
                    <h1>{product.name}</h1>
                </div>
            })}
        </div>
    )
}



export default Shop;
